import React from "react";

const oneFriendCard = (props) => {
    onDeleteButtonClicked = (e) => {
        e.preventDefault();
        console.log("you clicked delete")

    }


    return (
        <div key={props.id} className="card col-md-2 m-4">
            <div className="card-body">
                <h5 className="card-title">{props.name}</h5>
                <strong>{props.manufacturer}</strong>
                <p style={{ color: "blue" }} className="card-text">{props.description}</p>
                <p style={{ color: "green" }}>{props.cost}</p>
                <div>
                    <button
                        className="btn btn-danger m-1"
                    >
                        Delete
                    </button>
                    <span><button
                        className="btn btn-info m-1"
                        onClick={props.onDeleteButtonClicked}
                    >
                        Edit
                    </button></span>
                </div>
            </div>
        </div >
    )
}


export default React.memo(oneFriendCard);
